INSERT INTO `admin_to_do_list` (`to_do_list_id`, `to_do_list_reciepent`, `to_do_list_title`, `to_do_list_desc`, `to_do_list_notes`, `to_do_list_notes_date_time`, `to_do_list_datetime`, `to_do_list_target_days`, `to_do_list_priority`, `to_do_list_status`) VALUES
	(22, 'Darrel,Gary Bourne', 'Verify Identity', 'Users should verify identity by sending a copy of ID, of if they don\'t want to do that, write out their email address, and take a pic of that.\r\nonce they have done that, we can put on their profile that they have been verified.', NULL, NULL, '2021-05-29 14:47:00', NULL, '', '0'),
	(23, 'Darrel,Gary Bourne', 'Add Town/City/State-Province', 'At present we are only showing a country, we need to refine it better than that', NULL, NULL, '2021-05-29 14:47:00', NULL, '', '0'),
	(24, 'Gary Bourne', 'Create a wwwmedia email signature', 'Create a new Email Signature', NULL, NULL, '2021-05-29 14:47:00', NULL, '', '0'),
	(26, 'Gary Bourne,Sumanta Kundu,Bikram Kundu', 'Users to be able to delete their own account', NULL, NULL, NULL, '2021-05-29 14:47:00', NULL, '', '1'),
	(27, 'Gary Bourne,Sumanta Kundu,Bikram Kundu', 'To Do List additions', 'Edit\r\nNotes', NULL, NULL, '2021-05-29 14:47:00', NULL, '', '1'),
	(28, 'Gary Bourne,Sumanta Kundu,Bikram Kundu', 'To Do List additions', 'Edit\r\nNotes\r\nResend to emails when a "to do list" job has beed edited or added to.', NULL, NULL, '2021-05-29 14:47:00', NULL, 'Low', '1'),
	(29, 'Gary Bourne,Sumanta Kundu', '7. on the chat Bot', 'Did you forget your password', NULL, NULL, '2021-05-29 15:10:00', NULL, '', 'In Progress'),
	(30, 'Gary Bourne,Sumanta Kundu,Bikram Kundu', 'Make the "To Do List" into an app', 'fucken yea\r\nGreat work, I love it', NULL, NULL, '2021-05-29 15:10:00', NULL, '', 'In Progress'),
	(31, 'Darrel,Gary Bourne,Sumanta Kundu,Bikram Kundu', 'Deny explanation to a user', 'when a user put something in there like WhatsApp etc...... and we deny it, we need to an explanation.', NULL, NULL, '2021-05-29 15:15:00', NULL, '', '1'),
	(32, 'Gary Bourne,Elizabeth Martin,Sumanta Kundu', 'Elizabeth to Setup Accounting', 'You need to liaise with Sumanta to generate a seperate account number for every user, and assign it to payments online', NULL, NULL, '2021-05-29 15:15:00', NULL, '', '0'),
	(45, 'Darrel,Sumanta Kundu,Bikram Kundu', 'Inbox/sent/delete', 'the the messages, the users should have the ability to delete messages, also, why not have 3 different columns, inbox/sent/delete', NULL, NULL, '2021-05-31 18:23:00', '7', 'Medium', '0'),
	(47, 'Sumanta Kundu,Bikram Kundu', 'Profile pics', 'The user should have the ability to hide pics on a users profile', NULL, NULL, '2021-06-02 11:11:00', NULL, 'Low', '0'),
	(48, 'Sumanta Kundu,Bikram Kundu', 'Edit To Do list', 'Edit and add notes to to do list', NULL, NULL, '2021-06-02 11:11:00', NULL, 'Low', '1'),
	(49, 'Darrel,Sumanta Kundu,Bikram Kundu', 'Create To Do List under wwwmedia.world', 'This to do list should be for all web pages and companies \r\nSo, what needs to happen is wwwmedia.world needs its own (very simple) web page, and from that we log in, and from that there should be a directory of the different companies, when the to do list is updated, the directory should have a "new update" next to it so we know', NULL, NULL, '2021-06-02 11:11:00', NULL, 'Low', 'In Progress'),
	(51, 'Sumanta Kundu,Bikram Kundu', 'Upgrade to Premium', 'Hi there (member)\r\nCongratulations, you have been upgraded to 30 days Premium Access, this gives you Unlimited everything and everywhere.\r\n\r\nAs GlobalLove is very new, and is expanding rapidly (a new user is signing up every 10 minutes), we are relying on you to let us know about our service…….. is it ok, are you having issues?\r\n\r\n e.g. Browsing and messaging other members online is very important, so we want to know if there are any problems at all, if you are, below is a link to Customer Service, would would love to hear from you.\r\n\r\n\r\n“CUSTOMER SERVICE LINK”\r\n\r\n\r\nYour GlobalLove maybe only one message away.\r\n\r\nEmail Address:\r\nName:\r\nAddress:\r\nCity:\r\nState:\r\nCountry:\r\nPremium Access Price:  $10.00     (inc’ GST)\r\n\r\nThis is not a recurring payment, you will receive a 7 day reminder when the subscription is due.\r\n\r\n\r\nRegards,', NULL, NULL, '2021-06-02 14:17:00', NULL, 'Low', '1'),
	(52, 'Darrel,Sumanta Kundu,Bikram Kundu', 'Create Android/IOS app for the to do list', 'Create one under \r\nwwwmedia "to do"\r\ncomplete "Create to do list under wwwmedia.world" first..........', NULL, NULL, '2021-06-03 05:00:00', NULL, 'Low', 'In Progress'),
	(56, 'Darrel,Sumanta Kundu,Bikram Kundu', 'Put a search button on the data base', 'Add a search so we can search for users\r\nalso group them in \r\nCountry \r\npremium on top', NULL, '2021-06-04 08:02:40', '2021-06-04 08:02:40', NULL, 'High', '0');
